function f(x)
    return 1 / (1 + Base.MathConstants.e ^ (-x))
end

function f_prime(x)
    return (1 - f(x)) * f(x)
end

output = []
for c in 1:length(input)
    # input layer to hidden layer 1
    h1_inputs = h1_weights * input[c]
    h1_outputs = f.(h1_inputs)

    # hidden layer 1 to hidden layer 2
    h2_inputs = h2_weights * h1_outputs
    h2_outputs = f.(h2_inputs)

    # hidden layer to output layer 
    final_layer_in = final_weights * h2_outputs
    push!(output, f.(final_layer_in))
end

for i in 1:length(input)
    display_board(input[i])
    println("")
    println(output[i])
    display_board(output[i])
    println("---------------")
